\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWasted a whole day fishing with Jimmy. Didn’t catch a thing!’ With a deep sigh and a shaking hand he took Jimmy’s journal and found the boy’s entry for the same day, 4 June. Large scrawling letters pressed deep into the paper read, ‘Went fishing with my dad. Best day of my life.\n\nFebruary 11, 2017\n\u001c13\n\u0011\n\u0011\n\n\nChapter 1: Fishing for Life\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe think you should check out the filing cabinet marked ‘internal’. All the great feelings you ever experienced are already inside you!\n\nFebruary 11, 2017\n\u001c17\n\u0011\n\u0011\n\n\nChapter 3: Some of the People, Some of the Time\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cSo, in modern society, negativity rules! We could blame the media. It’s a given that if you switch on the news or pick up a paper then doom will prevail. We could point the finger at other people. The mood hoovers. You might even have married one! It’s hard to feel inspired if the people around you are having a ‘nightmare’. And then there’s the weather and the traffic!\n\nFebruary 11, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthat it’s easier to be negative. In fact, it takes no effort whatsoever to conform to ‘normal’. And if ‘normal’ means we gripe about the traffic and about the latest restructure at work and the economy and the state of the national sports teams and the weather, then so be it. We like to fit in. It’s so easy to be negative and focus on all the bad stuff in the world. Please compose yourself before reading the next sentence. Being positive is not easy.\n\nFebruary 11, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 11, 2017\n\u001c40\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIt’s considerably more challenging to be upbeat, happy and positive. And because it’s hard work and it takes practice, most people can’t be bothered\n\nFebruary 11, 2017\n\u001c41\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cPositive thinking will let you use the ability which you have, and that is awesome. It works this way. You can walk into a dark room, flip on the switch and immediately the room is lighted. Flipping the switch did not generate the electricity; it released the electricity which had been stored. Positive thinking works that way – it releases the abilities which you have\n\nFebruary 11, 2017\n\u001c43\n\u0011\n\u0011\n\n\nChapter 4: Glowing On the Outside\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHere’s an interesting thought for you. When was the last time you couldn’t sleep for excitement? Or the last time you stopped to smell some flowers? Or the last time you got up especially early to take a walk at sunrise? Or the last time you deliberately splashed in a puddle?\n\nFebruary 11, 2017\n\u001c51\n\u0011\n\u0011\n\n\nChapter 6: Busyness As Usual\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ccopy every man and his dog in to cover your back. Organisations over-communicate and under-converse. Knowledge is at our fingertips. Google has opened up a world of instant information. Then there’s fast food and microwave meals... ping... ‘tea’s ready’. My wife made a Christmas list and inked in at number one was a ‘ten second kettle’. You don’t have to wait for a cuppa nowadays. The kettle boils instantly! (I think she’s missing the point that the whole raison d’être of a cup of tea is that you sit down for a couple of minutes while the kettle boils.) Last night, I watched the BBC One-minute World News. A 100mph summary, crammed into 60 seconds, because we haven’t got time for proper news. You may have heard of a phenomenon called ‘speed dating’. Think about it. You’ve got 45 seconds to decide if you want to spend the rest of your life with this person.12 Why? ‘Busyness’, that’s why\n\nFebruary 18, 2017\n\u001c64\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOur nervous system works on the same principle. So, to protect us from going crazy, the information passes through three in-built filters. These are: 1. Deletion 2. Distortion 3. Generalisation\n\nFebruary 18, 2017\n\u001c66\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cOf the 40 delegates, 39 rated the course as ‘excellent’. There was one who put ‘good’. And I cursed and swore all the way home,\n\nFebruary 18, 2017\n\u001c67\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1cABqqIwkKBjVbeZfpTxdQ3TklPI-yNaVpuxvqdE","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1u_gPchJ6KGu8nxOazhwEr7yiuZCPUiTpyqEZfMM","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","o