fs_i":false}},{"ty":"as","st":"text","si":4123,"ei":4128,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="H+pvVm9q7kZ8NPUPgcGtQgwvuXw"  nonce="H+pvVm9q7kZ8NPUPgcGtQgwvuXw">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="H+pvVm9q7kZ8NPUPgcGtQgwvuXw"  nonce="H+pvVm9q7kZ8NPUPgcGtQgwvuXw">DOCS_modelChunk = [{"ty":"is","ibi":4129,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 18, 2017\n\u001c72\n\u0011\n\u0011\n\n\nChapter 7: Pants on the Outside\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 18, 2017\n\u001c75\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 18, 2017\n\u001c78\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cYou cannot tell somebody what to value. Values come from within\n\nFebruary 18, 2017\n\u001c80\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cFebruary 18, 2017\n\u001c80\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnd the truth is that ‘happiness’ is a fantastic pot of emotional gold at the end of the rainbow. But what if it’s not at the far end? What if it’s at our end? What if it’s not the result of getting great grades but, rather, it’s the key to getting great grades? What if it’s the happiest kids that do best at school? What if it’s the most upbeat and happy sales person that attracts the most customers and effortlessly achieves their targets? What if being happy NOW is the key to finding your perfect partner?\n\nFebruary 18, 2017\n\u001c80\n\u0011\n\u0011\n\n\nChapter 12: Tigger is a Trigger (And Eeyore is Too!)\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cAnother very basic rule of human interaction is that you impact on everyone you ever meet. In fact you cannot NOT have an impact. When you walk into a room your presence affects people. Incidentally, I once read an appraisal form on which the manager had written, ‘This person lights up the room, when\n\nFebruary 25, 2017\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cthey leave!’ Ouch!\n\nFebruary 25, 2017\n\u001c109\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe principle is that the first four minutes of every interaction are the most important. So, I now go home with the objective of triggering a positive set of feelings in my family. It’s a conscious and determined effort to ditch the old habits of whingeing, moaning and griping. I ask my children about the highlight of their day. And I ask them enthusiastically. Then I listen for the answer and engage with them. Getting home has become a thing of joy and smiles. The children no longer retreat to their rooms while mum and dad whinge about their day, sapping each other’s energy in the process.\n\nFebruary 25, 2017\n\u001c112\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cBottom line? The impact you are having on your fellow human beings is profound. So, if you’re going to have an impact anyway, we think you should strive to make it a positive one. Let me set the scene for this awesome quote below. My son plays rugby on a Sunday morning. Kev Brown is one of the dads and also the coach. He, like many other parents, gives up masses of time and is a role model of positivity. He took a minibus of under 10s to Twickenham to watch Leicester v. Wasps, leaving at 10am and getting back at midnight. So I dropped him a quick ‘thank you’ email and this is the response I got, word for word..\n\nFebruary 25, 2017\n\u001c116\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cIn the grand scheme of things as our planet hurtles through space, spinning on its axis, we are completely and utterly insignificant dots of life flickering on a tiny rock, lost among billions of other tiny rocks in the solar system. On this grand scale our lives are over in the blink of an eye. In this scenario, our insignificance is staggering. But to all those we live and work with (and our children in particular) we are incredibly significant because we form part of their world. We are shaping their character, forming their\n\nFebruary 25, 2017\n\u001c117\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbelief systems and affecting their quality of life. Boy are we significant!\n\nFebruary 25, 2017\n\u001c117\n\u0011\n\u0011\n\n\nChapter 15: Share a Hugg\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMarch 1, 2017\n\u001c139\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe prefer HUGGs. These are Huge Unbelievably Great Goals. HUGGs are whopping goals, on the edge of achievability. You’ll need to stretch yourself to attain them. You won’t achieve your Huge Unbelievably Great Goal by sitting watching Eastenders (unless your goal is to watch every episode of Eastenders, in which case you’ve got a remarkably sad life).\n\nMarch 1, 2017\n\u001c139\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThere’s an awful lot of nonsense written about goal setting. David Taylor demystifies it in his brilliant book, The Naked Leader (2002). David distils it down into the following four stages: 1. Work out where you are now 2. Work out where you want to be 3. Work out what you have to do to get there 4. Do it! Wow! Have you ever read anything so brilliantly simple? David Hyner introduced me to his goal setting pyramid some years ago. David is the guru of goal setting.\n\nMarch 1, 2017\n\u001c141\n\u0011\n\u0011"}
}'


